    },
    {
      "lineNumber": 158884,
      "originalJapaneseLine": "全身に炎をまとわりつかせたハウゼルが、",
      "translatedEnglishLine": "Housel, wrapped in flames all over his body,"
    },
    {
      "lineNumber": 158885,
      "originalJapaneseLine": "武器から大量の火を吐き出し、",
      "translatedEnglishLine": "spewed a massive amount of fire from his weapon,"
    },
    {
      "lineNumber": 158886,
      "originalJapaneseLine": "洞窟内を火の海へと変えていく。",
      "translatedEnglishLine": "turning the cave into a sea of flames."
    },
    {
      "lineNumber": 158887,
      "originalJapaneseLine": "「わわわ、こりゃ手がつけられん！",
      "translatedEnglishLine": "\"W-w-w, this is uncontrollable!"
    },
    {
      "lineNumber": 158888,
      "originalJapaneseLine": "　に、逃げるぞ！」",
      "translatedEnglishLine": "L-let's get out of here!\""
    },
    {
      "lineNumber": 158889,
      "originalJapaneseLine": "「うぁああああぁあ！」",
      "translatedEnglishLine": "\"Waaaaaaaah!\""
    },
    {
      "lineNumber": 158890,
      "originalJapaneseLine": "ハウゼルにはもはやランスも作者である",
      "translatedEnglishLine": "Housel could no longer see Rance or the author,"
    },
    {
      "lineNumber": 158891,
      "originalJapaneseLine": "ドエススキーも見えてはいない。",
      "translatedEnglishLine": "Doesusky as well."
    },
    {
      "lineNumber": 158892,
      "originalJapaneseLine": "ただ暴走した炎が迸る。",
      "translatedEnglishLine": "Only the runaway flames burst forth."
    },
    {
      "lineNumber": 158893,
      "originalJapaneseLine": "その姿はまるで怒りを",
      "translatedEnglishLine": "That figure was like anger"
    },
    {
      "lineNumber": 158894,
      "originalJapaneseLine": "具現化した化け物のようだった。",
      "translatedEnglishLine": "embodied as a monstrous creature."
    },
    {
      "lineNumber": 158895,
      "originalJapaneseLine": "「お、おお……」",
      "translatedEnglishLine": "\"O-oh...\""
    },
    {
      "lineNumber": 158896,
      "originalJapaneseLine": "「この火は読者の怒りそのものじゃ……」",
      "translatedEnglishLine": "\"This fire is the very anger of the readers...\""
    },
    {
      "lineNumber": 158897,
      "originalJapaneseLine": "「儂は……",
      "translatedEnglishLine": "\"I... "
    },
    {
      "lineNumber": 158898,
      "originalJapaneseLine": "　この炎に抱かれなければ、いかん……」",
      "translatedEnglishLine": "must be embraced by these flames...\""
    },
    {
      "lineNumber": 158899,
      "originalJapaneseLine": "ドエススキーは業火の中に",
      "translatedEnglishLine": "Doesusky staggered, drawn into the inferno."
    },
    {
      "lineNumber": 158900,
      "originalJapaneseLine": "ふらふらと吸い込まれていった。",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 158901,
      "originalJapaneseLine": "「ドエススキー先生！？」",
      "translatedEnglishLine": "\"Teacher Doesusky!?\""
    },
    {
      "lineNumber": 158902,
      "originalJapaneseLine": "「老いぼれなんぞ放っておけ！",
      "translatedEnglishLine": "\"Forget about that old geezer!"
    },
    {
      "lineNumber": 158903,
      "originalJapaneseLine": "　それより今すぐ避難を――」",
      "translatedEnglishLine": "More importantly, evacuate right now—\""
    },
    {
      "lineNumber": 158904,
      "originalJapaneseLine": "「ああ！　駄目です！",
      "translatedEnglishLine": "\"Ah! No good!"
    },
    {
      "lineNumber": 158905,
      "originalJapaneseLine": "　出口はもう炎に包まれて……！」",
      "translatedEnglishLine": "The exit is already engulfed in flames...!\""
    },
    {
      "lineNumber": 158906,
      "originalJapaneseLine": "「ほ、他に出口はないのか！？",
      "translatedEnglishLine": "\"I-Isn't there another exit!?"
    },
    {
      "lineNumber": 158907,
      "originalJapaneseLine": "　どうなんだ、リア！」",
      "translatedEnglishLine": "What do you think, Ria!\""
    },
    {
      "lineNumber": 158908,
      "originalJapaneseLine": "「えっとねー。",
      "translatedEnglishLine": "\"Well..."
    },
    {
      "lineNumber": 158909,
      "originalJapaneseLine": "　こんなことになると思ってなかったから、",
      "translatedEnglishLine": "I didn't think something like this would happen,"
    },
    {
      "lineNumber": 158910,
      "originalJapaneseLine": "　入り口は一つしかないの」",
      "translatedEnglishLine": "so there's only one entrance.\""
    },
    {
      "lineNumber": 158911,
      "originalJapaneseLine": "「ごめんちゃい♪」",
      "translatedEnglishLine": "\"So sorry♪\""
    },
    {
      "lineNumber": 158912,
      "originalJapaneseLine": "「なにぃー！？」",
      "translatedEnglishLine": "\"Whaaat!?\""
    },
    {
      "lineNumber": 158913,
      "originalJapaneseLine": "「げえええ！　ハウゼルが来る来る来る！」",
      "translatedEnglishLine": "\"Gyaaaah! Housel's coming, coming, coming!\""
    },
    {
      "lineNumber": 158914,
      "originalJapaneseLine": "「ぎゃああああああああああああああ！」",
      "translatedEnglishLine": "\"Aaaaaaaaaaaaaaahhhhh!\""
    },
    {
      "lineNumber": 158915,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 158916,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 158917,
      "originalJapaneseLine": "この日、世界を率いる総統であるランス、",
      "translatedEnglishLine": "On this day, Rance, the Supreme Leader of the world,"
    },
    {
      "lineNumber": 158918,
      "originalJapaneseLine": "魔人討伐隊、リーザス女王リアが、",
      "translatedEnglishLine": "the Demon Subjugation Squad, and Queen Ria of Leazas,"
    },
    {
      "lineNumber": 158919,
      "originalJapaneseLine": "消し炭すら残さずこの世から消えた。",
      "translatedEnglishLine": "vanished from this world without even leaving charcoal behind."
    },
    {
      "lineNumber": 158920,
      "originalJapaneseLine": "「あら？　私、今までいったい何を……」",
      "translatedEnglishLine": "\"Oh? What have I been doing all this time...\""
    },
    {
      "lineNumber": 158921,
      "originalJapaneseLine": "「あっつ……儂、溶けちゃいそう……」",
      "translatedEnglishLine": "\"So hot... I feel like I'm going to melt...\""
    },
    {
      "lineNumber": 158922,
      "originalJapaneseLine": "「魔剣カオス？",
      "translatedEnglishLine": "\"Magic Sword Chaos?"
    },
    {
      "lineNumber": 158923,
      "originalJapaneseLine": "　どうしてこんな場所に……",
      "translatedEnglishLine": "Why is it in a place like this..."
    },
    {
      "lineNumber": 158924,
      "originalJapaneseLine": "　そもそもここはどこかしら……」",
      "translatedEnglishLine": "And where exactly is this place to begin with...?\""
    },
    {
      "lineNumber": 158925,
      "originalJapaneseLine": "「きゃーっ、ハウゼル様すごいです、すごいです！」",
      "translatedEnglishLine": "\"Kyaaa! Lord Housel is amazing, amazing!\""
    },
    {
      "lineNumber": 158926,
      "originalJapaneseLine": "「あら、火炎……",
      "translatedEnglishLine": "\"Oh, flames..."
    },
    {
      "lineNumber": 158927,
      "originalJapaneseLine": "　ねえ、これは何があったの……？」",
      "translatedEnglishLine": "Hey, what happened here...?\""
    },
    {
      "lineNumber": 158928,
      "originalJapaneseLine": "「あ、ハウゼル様はお気になさらず。",
      "translatedEnglishLine": "\"Ah, please don't worry about Lord Housel."
    },
    {
      "lineNumber": 158929,
      "originalJapaneseLine": "　えへへ、それよりもお手柄ですよ。",
      "translatedEnglishLine": "Hehe, more importantly, you did a great job."
    },
    {
      "lineNumber": 158930,
      "originalJapaneseLine": "　きっといっぱい褒められますよ」",
      "translatedEnglishLine": "I'm sure you'll be praised a lot.\""
    },
    {
      "lineNumber": 158931,
      "originalJapaneseLine": "「？？　そ、そう……」",
      "translatedEnglishLine": "\"?? Oh, r-right...\""
    },
    {
      "lineNumber": 158932,
      "originalJapaneseLine": "元凶となったハウゼルは",
      "translatedEnglishLine": "Housel, the culprit,"
    },
    {
      "lineNumber": 158933,
      "originalJapaneseLine": "いつまでも首をかしげていた。",
      "translatedEnglishLine": "kept tilting his head in confusion."
    },
    {
      "lineNumber": 158934,
      "originalJapaneseLine": "（なんとなくやめておこう……",
      "translatedEnglishLine": "(Somehow, I should stop..."
    },
    {
      "lineNumber": 158935,
      "originalJapaneseLine": "　なんか、危険な気がする）",
      "translatedEnglishLine": "I have a feeling this is dangerous.)"
    },
    {
      "lineNumber": 158936,
      "originalJapaneseLine": "「残念だな、お前も見ただろう。",
      "translatedEnglishLine": "\"It's a pity, you saw it too, right?"
    },
    {
      "lineNumber": 158937,
      "originalJapaneseLine": "　200人以上が並んでいたのだ。",
      "translatedEnglishLine": "More than 200 people were lined up."
    },
    {
      "lineNumber": 158938,
      "originalJapaneseLine": "　とっくに売れてしまったわ」",
      "translatedEnglishLine": "They were all sold out long ago.\""
    },
    {
      "lineNumber": 158939,
      "originalJapaneseLine": "「そんな……」",
      "translatedEnglishLine": "\"No way...\""
    },
    {
      "lineNumber": 158940,
